import React from 'react';
import { StyleSheet, } from 'react-native';
import MainScreen from './src/components/screens/MainScreen';
import { createStackNavigator } from '@react-navigation/stack';
import { NavigationContainer } from '@react-navigation/native';
import SubScreen from './src/components/screens/SubScreen';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import ThirdScreen from './src/components/screens/ThirdScreen';
import FourthScreen from './src/components/screens/FourthScreen';

const App = () => {

  const Stack = createStackNavigator();
  const Tab = createBottomTabNavigator();

  return (
    <NavigationContainer>
      <Stack.Navigator >
        <Stack.Screen name="MainScreen" component={MainScreen} options={{ title: 'My first page' }} />
        <Stack.Screen name="SubScreen" component={SubScreen} />
      </Stack.Navigator>
      <Tab.Navigator>
        <Tab.Screen name="ThirdScreen" component={ThirdScreen} />
        <Tab.Screen name="FourthScreen" component={FourthScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  tinyLogo: {
    width: 100,
    height: 100,
  },
  input: {
    height: 40,
    margin: 12,
    borderWidth: 1,
    padding: 10,
  },
});

export default App
